function addMarker(a,o){positions=makeLocationArray(o);for(var r=0;r<positions.length;r++){var n=new google.maps.Marker({position:positions[r]});n.setMap(a),n.setDraggable(!1)}}function makeLocationArray(a){for(var o=new Array,r=a.split(";"),n=0;n<r.length;n++)if(r[n].trim()){var t=r[n].split(",");o[n]=new google.maps.LatLng(t[0],t[1])}return o}